    [],nt"revision_timestamp": "2016-07-27T22:44:54.155935",nt"name": "geology-of-the-johnson-river-area-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "The vegetation, topography, and geology
    of the Johnson River area are representative of the entire eastern interior region
    of Alaska. This area has a vegetational cover of both boreal forest and upland tundra,
    has a continental subarctic climate, and is within the zone of discontinuous permafrost.
    The topographic units include the rolling hills of the Yukon-Tanana Upland, the
    terraces and moraines on the Tanana-Kuskokwim and Northway-Tanacross Lowlands, and
    the rugged peaks and deep canyons of the Alaska Range. The bedrock is composed mostly
    of metamorphic and igneous rocks. The metamorphic rocks, largely schist and gneiss,
    have been profoundly deformed and are possibly Precambrian in age. Quartzite, hornfels,
    and amphibolite are minor constituents: of the metamorphic complex. The metamorphic
    rocks have been invaded by granitic rocks of Cretaceous age, and dikes of several
    ages cut both the metamorphic and igneous masses. Contacts between the igneous and
    metamorphic rocks include contact breccias, crosscutting intrusive contacts, and
    a contact zone of mixed igneous and metamorphic rocks. Although the granitic rocks
    include granodiorite, granite, quartz monzonite, quartz diorite, and diorite, similarities
    in mineral and chemical composition of representative rocks and similarity in the
    absolute age of scattered specimens suggest that they are genetically related and
    probably part of a single pluton. Lead-alpha age determinations were in close agreement
    and ranged from 90 to 110 (u00b110) million years.",nt"license_title": "License
